import React, { useState } from "react";
import Server from "./server/server";
import Navbar from "./navbar";
const Dashboard = () => {
  const [main, setMain] = useState("server");
  return (
    <div style={{ maxWidth: "1300px", minHeight: "100%", margin: "auto" }}>
      <Navbar setMain={setMain}></Navbar>
      {main === "server" ? (
        <Server></Server>
      ) : main === "users" ? (
        <Users></Users>
      ) : (
        <Stats></Stats>
      )}
    </div>
  );
};

export default Dashboard;
